import React from "react";

const Aside = () => {
  return (
    <div className="w-1/5 flex-col flex gap-4 si">
      <div>Fruits & Vegetables</div>
      <div>Meat & Fish</div>
      <div>Snacks</div>
      <div>Pet Care</div>
      <div>Home & Cleaning</div>
      <div>Dairy</div>
      <div>Cooking</div>
      <div>Breakfast</div>
      <div>Beverages</div>
      <div>Health & Beauty</div>
    </div>
  );
};

export default Aside;
